// Dependencies.
import { Link } from "react-scroll";
import React from 'react';

// Component 'TopScroll'.
function TopScroll() {
    return (
        // TopScroll Container.
        <>
            <Link className="nav-link hvr-grow text-white LinkLoadContent"
                activeClass="active" href="#AboutMe" to="AboutMe"
                spy={true}
                smooth={true}
                offset={0}
                delay={1000}
                duration={500}>
                <button id="TopScroll" className="animated fadeInRight slow btn btn-info">Back to Top</button>
            </Link>
        </>
    );
}

// Do export.
export default TopScroll;
